// ProfileUpdatePage.js
import React, { useState } from 'react';
import './ProfileUpdatePage.css'; // Ensure your CSS file is named correctly

const ProfileUpdatePage = () => {
  const [phoneNumber, setPhoneNumber] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [profilePicture, setProfilePicture] = useState(null);
  
  const handleSubmit = async (event) => {
    event.preventDefault();
    const formData = new FormData();
    formData.append('userId', 'your-user-id'); // Replace with actual user ID
    formData.append('phone', phoneNumber);
    formData.append('email', email);
    formData.append('password', password);
    
    if (profilePicture) {
      formData.append('profilePicture', profilePicture);
    }
    
    try {
      const response = await fetch('http://localhost:3001/update-profile', {
        method: 'POST',
        body: formData,
      });
      
      const result = await response.json();
      if (result.message) {
        alert(result.message);
      }
      // Handle success or navigate to another page
    } catch (error) {
      console.error('Error updating profile:', error);
      alert('An error occurred while updating the profile.');
    }
  };
  
  return (
    <div className="profile-update-page">
      <h1>Update Profile</h1>
      <form onSubmit={handleSubmit}>
        {/* ... other input fields ... */}
        <input
          type="file"
          name="profilePicture"
          onChange={e => setProfilePicture(e.target.files[0])}
        />
        <button type="submit">Update Profile</button>
      </form>
    </div>
  );
};

export default ProfileUpdatePage;
